import React,{Component} from 'react';
import Index from './frontEnd/Index';
import Admin from './Admin/Admin';
import {BrowserRouter,Route ,IndexRoute, browserhHistory,Switch} from  'react-router-dom';

class Main extends Component{
	render(){
		return(
			<div>
         		<BrowserRouter>
		         <div>
		         	 <Switch>
		            	<Route path	="/" exact strict render={()=>{
									return(
										<Index />
								)
								}}/>
		         	 </Switch>

		         </div>
     			 </BrowserRouter>
     			 <BrowserRouter>
		         <div>
		         	 <Switch>
		            			<Route path="/admin" exact render={()=>{
									return(
										<Admin />
									)
								}} />
		         	 </Switch>

		         </div>
     			 </BrowserRouter>
     		</div>

		);
	}
}
export default Main;
